# <!DOCTYPE HTML>\r\n\r\n<HTML lang="en">\r\n  <HEAD>\r\n    <meta name="description"          content="Python is a highly dynamic, powerful, object-oriented programming language that scales easily from simple scripts for casual one-use programs, to a many-thousand line applications.  Python is a very good language for learning programming, because it is interpreted, dynamically typed, well documented, and has several sources of free documentation. Part of this is due to Python\'s roots, which are in education.  Python\'s originator is Guido van Rossum. He worked for the CWI, the National Research Institute for Mathematics and Computer Science, Netherlands. There he worked extensively on ABC, an interpreted, procedural programming language originally designed for easy learning, and education use, to replace BASIC. But in time, he wanted a language with more features, object-orientation, flexibility, and extensibility. So he took many ideas and traits of ABC, especially the syntax, and created Python.">\r\n    <meta name="keywords"             content="Computers, Programming, Languages, Python">\r\n    <meta name="viewport"             content="width=device-width, initial-scale=1">\r\n    <meta http-equiv="Content-Type"   content="text/html; charset=UTF-8">\r\n\r\n    <TITLE>DMOZ - Computers: Programming: Languages: Python</TITLE>\r\n\r\n    <meta property="og:url"           content="" />\r\n    <meta property="og:type"          content="website" />\r\n    <meta property="og:title"         content="DMOZ - Computers: Programming: Languages: Python" />\r\n    <meta property="og:description"   content="The Directory of the Web" />\r\n    <meta property="og:image"         content="/img/mozzie-banner.png" />\r\n\r\n    <link rel="icon"          type="image/x-icon"  href="/img/mozilla.gif"      />\r\n    <link rel="shortcut icon" type="image/x-icon"  href="/img/mozilla.gif"      />\r\n\r\n    <link rel="stylesheet"    type="text/css"      href="/css/slick/slick.css"  />\r\